function get3dTheme(){

    var theme_3d = {
        "left" : "data:image/png;base64,",
        "right" : "data:image/png;base64,",
        "lupa" : "data:image/png;base64,"
    };

    return theme_3d;
}


$( document ).ready(function() {
    var theme_3d = get3dTheme();

    $('.fast_search_prev').css('background','url(' + theme_3d['left'] + ')');
    $('.fast_search_next').css('background','url(' + theme_3d['right'] + ')');
    $('.fast_search_result').css('background','#fff').css('border','5px solid #FF3D22').css('border-radius','0').css('border-bottom-color','#00CBFF')
        .css('border-left-color','#00CBFF');
    $('#searchbox_id').css('background','url(' + theme_3d['lupa'] + ')no-repeat #fff').css('border','2px solid #ECEDEC')
        .css('border-radius','0').css('background-position-y','2px').css('background-position-x','98%');
    //$('.fast_search_result input[type="text"]')
// minimization of search form
    chrome.storage.sync.get('fast_search_minimal_style', function(a) {
        var x = a['fast_search_minimal_style'];
        if(x){
            minimize_search_form();
        }
        else
        {
            maximize_search_form();
        }
    });

    //minimize_search_form();
});

function maximize_search_form()
{
    $('.fast_search_result').removeClass('mini');
}


function minimize_search_form()
{
    $('.fast_search_result').addClass('mini');
}